import styled from 'styled-components';

const Styled = styled.img`
  /* margin: 5em 0; */

  max-width: 500px;
  margin: 0 auto;
`;

const Barbell = ({ addClass }) => {
  return (
    <Styled
      className={`barbell ${addClass}`}
      src='olympic_barbell.svg'
      alt='barbell'
    />
  );
};

export default Barbell;
